import Vue from 'vue'
import App from './App.vue'
import VueRouter from 'vue-router'//官方路由
import Vant from 'vant';
import 'vant/lib/index.css';


Vue.config.productionTip = false

Vue.use(VueRouter)
Vue.use(Vant);
new Vue({
  render: h => h(App),
}).$mount('#app')
